import React from 'react';
import Heading from './Heading';
import List from './List';
import Img from './Img';
import img from './images/i3.jpg';
// import './index.css';
import { sum, sub, mult, div } from './Cal';
import Images from './images';
import Card from './Cards';
import Sdata from './Sdata';


const App = () => (
    <>
        <h1 className="heading_style">List of top 5 Netflix Series</h1>
        {Sdata.map((val, index) => {
            console.log(index);
            return (
                <Card
                    key={val.id}
                    imgscr={val.imgscr}
                    title={val.title}
                    sname={val.sname}
                    link={val.links}
                />
            );
        })
        };
    </>
)

export default App;
